  return (
    <Navbar bg='light'>
      <NavbarBrand>
        <img alt='' src='portfolio\client\src\menu_48px.png' width='46' height='46' className='d-inline-block align-top'/>{' '}
      </NavbarBrand>

    </Navbar>
  );
}

export default App;
